import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Post from './components/post/Post';
//import Home from "./pages/Home";
import Blog from "./pages/Blog";
//import About from "./pages/About";
import PostDetails from "./components/PostDetails";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import SigninPage from "./pages/SigninPage";
import { SignUpPage } from "./pages/SignUpPage";
import Writing from "./components/writing/Writing";
import { useState } from "react";

function App() {
    const[title, setTitle]=useState('');
    const[content, setContent]=useState('');
    const[id, setId]=useState('');
    const [author, setAuthor]=useState('');

    const[isSign]=useState(true);
    const data={id:'1', 
        title:"my article",
        content:"Hello this is mmy article and today we are currently blogging the website",
        author:"Chandrashekharan Rao"
    };
    return (
        <Router>
            <Navbar/>
            <Routes>
              <Route path="/" element={<Home isSign={isSign}/>}/>
                {/* <Route path="/" element={<Home />} /> */}
                {/* <Route path="/blog" element={<Blog />} /> */}
                <Route path="/signin" element={<SigninPage setAuthor={setAuthor} setId={setId}/>}/>
                <Route path="/signup" element={<SignUpPage/>}/>
                <Route path="/createblog" element={<Blog author={author} title={title} setTitle={setTitle} content={content} setContent={setContent} id={id}/>}/>   
                <Route path="/writing/:id" element={<Writing data={data}/>}/>
                {/* <Route path="/about" element={<About />} /> */}
                {/* <Route path="/blog/:id" element={<PostDetails />} /> */}
            </Routes>
        </Router>
    );
}

export default App;
